const maps = {
    "TheIsland": {
        label: "アイランド",
        image: "data:image/avif;base64,",
    },
}


async function fetchGoogleSpreadSheet(spreadSheatId, sheetName, apiKey) {
    const response = await fetch(`https://sheets.googleapis.com/v4/spreadsheets/${spreadSheatId}/values/${sheetName}?key=${apiKey}`)
    const pins = await response.json()
    return pins
}

function showMap(mapImage, positions = []) {
    const mapCanvasDiv = document.getElementById("map")
    mapCanvasDiv.width = 640
    mapCanvasDiv.height = 640
    const ctx = mapCanvasDiv.getContext('2d');

    ctx.drawImage(mapImage, 0, 0, 640, 640)
    positions.forEach(pos => {
        const x = (pos.long / 100.0) * 640
        const y = (pos.lat / 100.0) * 640

        ctx.fillStyle = pos.color
        ctx.beginPath()
        ctx.ellipse(x, y, 5, 5, 0, 0, 2 * Math.PI)
        ctx.fill()
        ctx.strokeStyle = "black"
        ctx.beginPath()
        ctx.ellipse(x, y, 5, 5, 0, 0, 2 * Math.PI)
        ctx.stroke()
    })
    
    const descDiv = document.getElementById("desc")
    function onMouseMove(e) {
        const elong = (e.clientX / 640.0) * 100
        const elat = (e.clientY / 640.0) * 100
        const pos = positions.find(pos => pos.long <= elong && elong <= pos.long + 2 && pos.lat <= elat && elat <= pos.lat + 2)
        if (pos) {
            descDiv.innerText = `${pos.name} (${pos.lat}, ${pos.long})`
        } else {
            descDiv.innerText = ""
        }
    }
    mapCanvasDiv.addEventListener('mouseover', e => {
        rect = e.target.getBoundingClientRect()
        mapCanvasDiv.addEventListener('mousemove', onMouseMove, false)
    }, false)
    mapCanvasDiv.addEventListener('mouseout', e => {
        mapCanvasDiv.removeEventListener('mousemove', onMouseMove, false)
    }, false)
}


const currentUrl = window.location.href;
const searchParams = new URLSearchParams(new URL(currentUrl).search);

const spreadSheatId = searchParams.get('ssid')
const sheetName = searchParams.get('sn')
const apiKey = searchParams.get('k')
const mapName = searchParams.get('map')
const serverNumber = searchParams.get('num')

window.addEventListener("load", async () => {

    const map = maps[mapName]
    const mapImage = new Image()

    const pins = await fetchGoogleSpreadSheet(spreadSheatId, sheetName, apiKey)
    const positions = pins.values.filter(val => val[0] === mapName && val[1] === serverNumber).map(val => {
        return { name: val[4], lat: parseFloat(val[3]), long: parseFloat(val[2]), color: val[5] }
    })

    mapImage.addEventListener("load", () => {
        showMap(mapImage, positions)
    })
    mapImage.src = map.image
})
